import React, { Component } from 'react';
import logo from '../assets/logo.svg';
import '../css/App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Hi, I am not React dev.</h1>
      </div>
    );
  }
}

export default App;
